INSERT INTO `trl_email_format` (`email_format_ID`, `email_format_name`, `email_format`) VALUES
(1, 'Sign up', '<p>{Name},</p>\r\n\r\n<p><br />\r\nThank you for signing up for a {Listing Type} Listing for {Amount}/month,</p>\r\n\r\n<p>To set up &amp; manage your listing go here:</p>\r\n'),
(3, 'User grant access ', '<p>{Name},</p>\r\n\r\n<p>You have been granted access to rate {Business Name}.</p>\r\n\r\n<p>Click this link below to post your rating:</p>\r\n'),
(4, 'User reminder to rate', '<p>{NAme},</p>\r\n\r\n<p>This is a reminder to rate {Business Name}</p>\r\n\r\n<p>At:</p>\r\n'),
(5, 'Post rating', '<p>{Name},</p>\r\n\r\n<p>Click this link below to edit your rating of {Business Name}</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(6, 'A new customer has requested access to rate your business', '<p>(Name),</p>\r\n\r\n<p>A new customer has requested access to rate your business.</p>\r\n\r\n<p><br />\r\n(Customer Name)<br />\r\n(Customer Email)</p>\r\n\r\n<p>Click this link below to Manage your rating request:</p>\r\n\r\n<p>(Link)</p>\r\n'),
(7, 'Your business was just rated', '<p>(Name),</p>\r\n\r\n<p>Your business was just rated by:</p>\r\n\r\n<p><br />\r\n(Customer Name)<br />\r\n(Customer Email)</p>\r\n\r\n<p>Click this link below to Manage your rating request:</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(8, 'Your business rating was just edited', '<p>(Name),</p>\r\n\r\n<p>A rating was just edited by:</p>\r\n\r\n<p>(Customer Name)<br />\r\n(Customer Email)</p>\r\n\r\n<p>Click this link below to Manage your rating request:</p>\r\n\r\n<p>&nbsp;</p>\r\n');
